import React,{useState} from "react";
//import { Link } from 'react-router-dom;'
import "./Gruup.css";

const GroupButton = () => {
    const [Group,setGroup]=useState("");
    const ClickHandle=(e)=>{
      setGroup(e.target.value);
    }
    //TODO:２つのグループ化にする
    return (
      <div className="Gruup">
        <div className="GrupDis">
            <p>グループ一覧</p>
        </div>

        <div className="NameDisplay">
            <p>{Group}</p>
        </div>


        <div className="memberDis">
            <input className="GrupBtn1" type='button' value='Name0' />
            <input className="GrupBtn2" type='button' value='Name1' onClick={ClickHandle}/>
            <input className="GrupBtn3" type='button' value='Name2' onClick={ClickHandle}/>
        </div>
        <div className="addGroup">
          <svg xmlns="http://www.w3.org/2000/svg" width="190" height="190" viewBox="0 0 190 190" fill="none">
            <path fill-rule="evenodd" clip-rule="evenodd" d="M119.772 0H69.7724V40.4404C66.3388 42.0163 63.0797 43.9068 60.0318 46.075L25 25.8494L0 69.1506L35.0325 89.3766C34.8604 91.228 34.7724 93.1037 34.7724 95C34.7724 96.8963 34.8604 98.772 35.0325 100.623L0 120.849L25 164.151L60.0318 143.925C63.0797 146.093 66.3388 147.984 69.7724 149.56V190H119.772V149.56C123.206 147.984 126.465 146.093 129.513 143.925L164.545 164.151L189.545 120.849L154.512 100.623C154.684 98.772 154.772 96.8963 154.772 95C154.772 93.1037 154.684 91.228 154.512 89.3766L189.545 69.1506L164.545 25.8494L129.513 46.075C126.465 43.9068 123.206 42.0163 119.772 40.4404V0ZM95 115C106.046 115 115 106.046 115 95C115 83.9543 106.046 75 95 75C83.9543 75 75 83.9543 75 95C75 106.046 83.9543 115 95 115Z" fill="#14FF00"/>
          </svg>
        </div>
      </div>
    );
}
